      out.write("		str = str.split(\";\");\n");
      out.write("		str.forEach(function(val){\n");
      out.write("			val = val.split(\"=\");\n");
      out.write("			result[val[0].trim()] = decodeURIComponent(val[1] || '');\n");
      out.write("		});\n");
      out.write("		locale = result.lang;\n");
      out.write("	}\n");
      out.write("	\n");
      out.write("	return locale;  \n");
      out.write("}\n");
