      out.write("function Time(t) {\n");
      out.write("	t = new (function() {\n");
      out.write("	    // Stopwatch element on the page\n");
      out.write("	    var $stopwatch;\n");
      out.write("	    // Timer speed in milliseconds\n");
      out.write("	    var incrementTime = 70;\n");
      out.write("	    // Current timer position in milliseconds\n");
