      out.write("	        $stopwatch = $(\"#\"+t).find(\"div .cont_cell\");\n");
      out.write("	        console.log( $(\"#\"+t).find(\"div .cont_cell\").html());\n");
      out.write("	        t= $.timer(updateTimer, incrementTime, true);  \n");
      out.write("	    });\n");
      out.write("	    // Output time and increment\n");
