      out.write("    var month = (1 + date.getMonth());          //M\n");
      out.write("    month = month >= 10 ? month : '0' + month;  //month 두자리로 저장\n");
      out.write("    var day = date.getDate();                   //d\n");
      out.write("    day = day >= 10 ? day : '0' + day;          //day 두자리로 저장\n");
      out.write("    return  year+'-'+month+'-'+day;\n");
      out.write("}\n");
